import { Component } from '@angular/core';
import { MatCardModule } from '@angular/material/card';
import { MatChipsModule } from '@angular/material/chips';
import { Color, LegendPosition, NgxChartsModule } from '@swimlane/ngx-charts';

@Component({
  selector: 'app-package',
  standalone: true,
  imports: [MatCardModule, MatChipsModule, NgxChartsModule],
  templateUrl: './package.component.html',
  styleUrls: ['./package.component.css'],
})
export class PackageComponent {
  single = [
    {
      name: 'ניצול',
      value: 20,
    },
    {
      name: 'יתרה',
      value: 80,
    },
  ];
  view: [number, number] = [700, 400];

  // options
  gradient: boolean = true;
  showLegend: boolean = true;
  showLabels: boolean = true;
  isDoughnut: boolean = false;
  legendPosition: LegendPosition = LegendPosition.Below;

  colorScheme: string | Color = '#fa35ab';

  constructor() {}

  onSelect(data: any): void {
    console.log('Item clicked', JSON.parse(JSON.stringify(data)));
  }

  onActivate(data: any): void {
    console.log('Activate', JSON.parse(JSON.stringify(data)));
  }

  onDeactivate(data: any): void {
    console.log('Deactivate', JSON.parse(JSON.stringify(data)));
  }
}
<mat-card class="package">
  <mat-card-header>
    <mat-card-subtitle
      ><mat-chip color="primary">
        <img
          matChipAvatar
          src="https://material.angular.io/assets/img/examples/shiba1.jpg"
          alt="Photo of a Shiba Inu"
        />
        Package Type
      </mat-chip></mat-card-subtitle
    >
    <mat-card-title>Package Name</mat-card-title>
  </mat-card-header>
  <mat-card-content>
    <p>content</p>
    <ngx-charts-pie-chart [view]="view" [results]="single">
    </ngx-charts-pie-chart>
  </mat-card-content>
</mat-card>
